        input::-webkit-inner-spin-button,
        input::-webkit-outer-spin-button {
            appearance: none;
            margin: 0px;
        }

        .noScroll {
            overflow: hidden;
            cursor: default;
        }

        html {
            font-family: sans-serif;
        }

        body {
            margin: 0px;
        }

        article,
        aside,
        details,
        figcaption,
        figure,
        footer,
        header,
        hgroup,
        main,
        menu,
        nav,
        section,
        summary {
            display: block;
        }

        audio,
        canvas,
        progress,
        video {
            display: inline-block;
            vertical-align: baseline;
        }

        audio:not([controls]) {
            display: none;
            height: 0px;
        }

        [hidden],
        template {
            display: none;
        }

        a {
            background-color: transparent;
        }

        a:active,
        a:hover {
            outline: 0px;
        }

        abbr[title] {
            border-bottom: 1px dotted;
        }

        b,
        strong {
            font-weight: 700;
        }

        dfn {
            font-style: italic;
        }

        h1 {
            font-size: 2em;
            margin: 0.67em 0px;
        }

        mark {
            color: rgb(0, 0, 0);
        }

        small {
            font-size: 80%;
        }

        sub,
        sup {
            font-size: 75%;
            line-height: 0;
            vertical-align: baseline;
        }

        sup {
            top: -0.5em;
        }

        sub {
            bottom: -0.25em;
        }

        img {
            border: 0px;
        }

        svg:not(:root) {
            overflow: hidden;
        }

        figure {
            margin: 1em 40px;
        }

        hr {
            box-sizing: content-box;
            height: 0px;
        }

        pre {
            overflow: auto;
        }

        code,
        kbd,
        pre,
        samp {
            font-family: monospace, monospace;
            font-size: 1em;
        }

        button,
        input,
        optgroup,
        select,
        textarea {
            color: inherit;
            font: inherit;
            margin: 0px;
        }

        button {
            overflow: visible;
        }

        button,
        select {
            text-transform: none;
        }

        button,
        html input[type="button"],
        input[type="reset"],
        input[type="submit"] {
            appearance: button;
            cursor: pointer;
        }

        button[disabled],
        html input[disabled] {
            cursor: not-allowed;
        }

        input {
            line-height: normal;
        }

        input[type="checkbox"],
        input[type="radio"] {
            box-sizing: border-box;
            padding: 0px;
        }

        input[type="number"]::-webkit-inner-spin-button,
        input[type="number"]::-webkit-outer-spin-button {
            height: auto;
        }

        input[type="search"] {
            appearance: textfield;
            box-sizing: content-box;
        }

        input[type="search"]::-webkit-search-cancel-button,
        input[type="search"]::-webkit-search-decoration {
            appearance: none;
        }

        fieldset {
            border: 1px solid silver;
            margin: 0px 2px;
            padding: 0.35em 0.625em 0.75em;
        }

        legend {
            padding: 0px;
        }

        textarea {
            overflow: auto;
        }

        optgroup {
            font-weight: 700;
        }

        table {
            border-collapse: collapse;
            border-spacing: 0px;
        }

        td,
        th {
            padding: 0px;
        }

        html {
            box-sizing: border-box;
        }

        * {
            box-sizing: inherit;
        }

        ol,
        ul {
            padding-left: 2em;
        }

        ul.unstyled {
            list-style: none;
        }

        img {
            vertical-align: middle;
        }

        img:not([src=".svg"]) {
            height: auto;
        }

        blockquote,
        figure {
            margin-left: 0px;
            margin-right: 0px;
        }

